export default function Skills() {
    let skills = [
        {
            name: "HTML",
            icon: "fab fa-html5",
        },
        {
            name: "CSS",
            icon: "fab fa-css3-alt",
        },
        {
            name: "Javascript",
            icon: "fab fa-js",
        },
        {
            name: "PHP",
            icon: "fab fa-php",
